class Grid:
    def __init__(self, rows, cols):
        self.rows = rows
        self.cols = cols
        self.grid = [[0 for _ in range(cols)] for _ in range(rows)]  # 0 = dead, 1 = alive

    def display(self):
        for row in self.grid:
            print("".join(['X' if cell == 1 else '.' for cell in row]))

    def count_live_neighbors(self, row, col):
        count = 0
        for i in range(max(0, row - 1), min(self.rows, row + 2)):
            for j in range(max(0, col - 1), min(self.cols, col + 2)):
                if (i, j) != (row, col):
                    count += self.grid[i][j]
        return count

    def advance_generation(self):
        new_grid = [[0 for _ in range(self.cols)] for _ in range(self.rows)]
        for row in range(self.rows):
            for col in range(self.cols):
                live_neighbors = self.count_live_neighbors(row, col)
                if self.grid[row][col] == 1:  # Live cell
                    if 2 <= live_neighbors <= 3:
                        new_grid[row][col] = 1
                    else:
                        new_grid[row][col] = 0
                else:  # Dead cell
                    if live_neighbors == 3:
                        new_grid[row][col] = 1
                    else:
                        new_grid[row][col] = 0
        self.grid = new_grid


